import React from 'react'
class Dashboardcontent extends React.Component{
    constructor(props){
        super()

    }
render(){
    return(
        <div>
            <div className="div1">
                <div className="div1in1">
                    <div className="dc1">

                    </div>
                    <div className="dc2">

                    </div>
                </div>
                <div className="div1in2">
                <div className="dac1">

                </div>
                <div className="dac2">

                </div>

                </div>
            </div>
        
        
        <style>{`
        .div1{
            display:flex;
            flex-direction:column;
            align-items:center;
            background:pink;
            width:100%;
            height:950px;
        }
        .div1in1{
            display:flex;
            flex-direction:row;
            background:blue;
            width:70%;
            height:50%;
            justify-content:space-evenly;
        }
        .div1in2{
            background:red;
            width:100%;
            height:50%;
        }
        .dc1{
            background:yellow;
            width:48%;
            
        }
        .dc2{
            background:green;
            width:48%
            
        }
        .dac1{
            background:yellow;
            width:48%;
            
        }
        .dac2{
            background:green;
            width:48%
            
        }
        
        
        `}

        </style>
        
        
        
        </div>
    )


    }



}
export default Dashboardcontent;
